function buildListEntry(id, prop, diff) {
    var entry = {
        name: this.targetMorph.findById(id).getName(),
        item: diff,
        prop: prop,
        id: id,
    };
    var stringPart = (this.mode == "added" || this.mode == "removed") ? 
        diff.getName() : 
        prop;

    entry.string = "(" 
            + this.targetMorph.findById(id).getName() 
            + ") "
            + stringPart

    return entry
}

