function loadPartsBinVersion() {
    if (this.targetMorph) {
        this.otherMorph = this.targetMorph.findCurrentPartVersion();
        this.get("PreviewPane").addMorph(this.otherMorph);
        this.otherMorph.setPosition(pt(0,0));
        var e1 = this.get("PreviewPane").getExtent();
        var e2 = this.otherMorph.getExtent();
        var factor;
        if (e1.x>e2.x && e1.y>e2.y) factor = 1;
        else factor = (e1.x/e2.x < e1.y/e2.y)? e1.x/e2.x : e1.y/e2.y;
        this.otherMorph.setScale(factor);
        this.get("PreviewPane").adjustForNewBounds();
        this.otherMorph.layout = this.otherMorph.layout || {};
        this.otherMorph.layout.scaleHorizontal = true
        this.otherMorph.layout.scaleVertical = true
    }
}

