function findOtherFocusedMorph(focusedMorph, diff) {
    var focused = undefined;
    if (this.mode == "added") {
        focused = diff.item.findDerivationSibling(this.otherMorph)
    }
    else if (this.mode == "updated" || this.mode == "conflicted") {
        focused = focusedMorph.findDerivationSibling(this.otherMorph)
    }
    else if (this.mode = "removed") {
        focused = focusedMorph.owner.findDerivationSibling(this.otherMorph)
    }
    return focused
}

825.source:
function markMorph(morph, optMarker) {
    if (!morph) return
    var marker = optMarker || this.myMarkerMorph;
    $world.addMorph(marker)
    marker.setBounds(morph.globalBounds());
    if (marker == this.myMarkerMorph && this.mode == "removed") {    
        marker.setPosition(marker.getPosition().addPt(this.targetMorph.getPositionInWorld()))
    }
    marker.setVisible(true);
    marker.bringToFront();
    var o = this.myMarkerMorph === marker ? $world : this;
    o.addMorph(marker)
}

