function findFocusedMorph(diff) {
    console.log("start find focused morph")
    var focused = undefined;
    if (this.mode == "removed") {
        focused = diff.item
    }
    else {
        focused = this.targetMorph.findById(diff.id)
    }
    console.log("end find focused morph")
    return focused
}

